import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
    maxWidth: 500,
  },
  root: {
    flexGrow: 1,
  },
});

function createData(name, period, level) {
  return { name, period, level };
}

const rowsDB = [
  createData('MariaDB', '5ヶ月', 'インストールから簡単なテーブル作成が可能'),
  createData('MySQL', '1年1ヶ月', 'インストールから簡単なテーブル作成が可能'),
];

const rowsLibFW = [
  createData('React', '5ヶ月', '問題なく日常的に利用できる'),
  createData('Codeigniter', '5ヶ月', '簡単な利用が可能'),
  createData('jQuery', '5ヶ月', '問題なく日常的に利用できる'),
];

export default function SimpleTable() {
  const classes = useStyles();
  const spacing = React.useState(2);

  return (
    <Grid container className={classes.root} spacing={2}>
      <Grid item xs={12}>
        <Grid container justify="center" spacing={spacing}>
          <p>ライブラリ・FW</p>
          <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="skill table">
              <TableHead>
                <TableRow>
                  <TableCell>技術</TableCell>
                  <TableCell align="left">開発年数</TableCell>
                  <TableCell align="left">レベル</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rowsLibFW.map(row => (
                  <TableRow key={row.name}>
                    <TableCell component="th" scope="row">
                      {row.name}
                    </TableCell>
                    <TableCell align="left">{row.period}</TableCell>
                    <TableCell align="left">{row.level}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
          <p>DB</p>
          <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="skill table">
              <TableHead>
                <TableRow>
                  <TableCell>技術</TableCell>
                  <TableCell align="left">開発年数</TableCell>
                  <TableCell align="left">レベル</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rowsDB.map(row => (
                  <TableRow key={row.name}>
                    <TableCell component="th" scope="row">
                      {row.name}
                    </TableCell>
                    <TableCell align="left">{row.period}</TableCell>
                    <TableCell align="left">{row.level}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Grid>
      </Grid>
    </Grid>
  );
}
